import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/layout/Navbar';
import Home from './pages/Home';
import RegistroForm from './components/forms/RegistroForm';
import ContactoForm from './components/forms/ContactoForm';
import ProductoForm from './components/forms/ProductoForm';
import LoginForm from './components/forms/LoginForm';
import { AccessibilityProvider } from './context/AccessibilityContext';
import AccessibilityFAB from './components/accessibility/AccessibilityFAB'; // ðŸ‘ˆ importamos el botÃ³n flotante
import PantallaInicio from './pages/PantallaInicio';
function App() {
  return (
    <AccessibilityProvider>
      <Router>
        <Navbar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/registro" element={<RegistroForm />} />
          <Route path="/contacto" element={<ContactoForm />} />
          <Route path="/producto" element={<ProductoForm />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/" element={<PantallaInicio />} />
        </Routes>
        <AccessibilityFAB /> {/* ðŸ‘ˆ botÃ³n flotante visible en todas las rutas */}
      </Router>
    </AccessibilityProvider>
  );
}

export default App;
